    [],nt"num_tags": 0,nt"name": "multichannel-seismic-reflection-data-scar-ross-sea-1980-sdls-cd-rom-vol-3",nt"isopen":
    false,nt"url": null,nt"notes": "These data are stacked multichannel marine
    seismic reflection data from four lines recorded during 1980 in the Ross Sea, Antarctica,
    by the Bundesanstalt fur Geowissenschaften und Rohstoffe (BGR). The following data
    types are included for each line: computer display images, location maps, and the
    digital seismic data. Software is provided to view the images, to plot selected
    portions of the data to the screen, and to convert the data into SEG-Y formation.
    The CD-ROM was produced in accordance with the ISO 9660 Standard. The display software
    runs only under DOS. All text files are in ASCII format.",nt"owner_org": "e811f0b4-451f-4896-9e8f-fc6802837819",nt"extras":
